script: |
  super -f text -I q8688.spq | sort > q8688.out

inputs:
  - name: q8688.spq
    data: |
      SELECT ALL - 45 * - 93 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( - ( + col2 ) + 77 ) NOT BETWEEN NULL AND col0 * - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q8688.out
    data: |
